import "../../css/command.css";

const Contact = () => {
  return (
    <div>
      <p>Contact</p>

      <Link to="https://github.com/Greenaustin2">Github</Link>
      <a href="https://github.com/Greenaustin2" target="_blank">
        Github
      </a>
      <br />
      <a href="https://www.linkedin.com/in/austin--green/" target="_blank">
        LinkedIn
      </a>
      <br />
      <a href="https://www.instagram.com/a____green/" target="_blank">
        Instagram
      </a>
      <br />
      <a href="https://www.instagram.com/a____green/" target="_blank">
        Spotify
      </a>
    </div>
  );
};

export default Contact;
